import React from 'react'
import Navbar from './Navbar'
import data from './data'

export default function App(){
    const cards = data.map(card => {
        return (
            <Card 
            key={card.id}
            {...card}

            />
        )

    })


    return (
        <div>
            <Navbar />

        </div>
    )
}
